import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import RestaurantDashboard from './pages/RestaurantDashboard';
import RestaurantsPage from './pages/RestaurantsPage';
import RestaurantDetailPage from './pages/RestaurantDetailPage';
import OrderPage from './pages/OrderPage';
import './index.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/restaurants" element={<RestaurantsPage />} />
          <Route path="/restaurant/:id" element={<RestaurantDetailPage />} />
          <Route path="/order" element={<OrderPage />} />
          <Route path="/dashboard" element={<RestaurantDashboard />} />
          {/* TODO: Add these pages */}
          <Route path="/login" element={<div>Login Page - Coming Soon</div>} />
          <Route path="/restaurant-signup" element={<div>Restaurant Signup - Coming Soon</div>} />
          <Route path="/how-it-works" element={<div>How It Works - Coming Soon</div>} />
          <Route path="/contact" element={<div>Contact - Coming Soon</div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
